import AboutMe from './aboutme.js'
import Skills from './skills.js'
import Footer from './components/footer.js'
import './resources/style.css'
import Project from './components/projects.js';

const Container = () => {

    return (
        <div>
            <Header />
            <AboutMe />
            <Skills />
            <Project/>
        </div>
    );
}

export default Container;
